import Faq from './Faq'
import Header from './Header'
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Acceuil from './Acceuil'
import Footer from './Footer';



function App() {

  return (
    <div>
      <BrowserRouter>
        <Header />
        <Routes>

          <Route path="/Faq" element={<Faq />} />

        </Routes>
        <Faq />
      </BrowserRouter>
      <Footer />
    </div>
  )

}

export default App
